    if(window.innerWidth<=768){
      setslidein((state)=>!state)
    }
  }

  return (
    <div className="App">
      <Router>

      <Navbar handleslidein={handleslidein}/>
   <Allroutes slidein={slidein} handleslidein={handleslidein}/>
      </Router>
